import React from 'react';
import image from '../Images/item1.jpg';
import styled from 'styled-components';


class Products extends React.Component {
  render() {
    return(
      <React.StrictMode>
        <div>

          <LIST>
            <li>
              <img src = {image} alt="" />
              <p>{this.props.name}</p>
              <p>{this.props.price}</p>
            </li>
          </LIST>
        </div>
      </React.StrictMode>
    );
  }
}



const LIST = styled.ul`
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
  text-align: left;
  li{
      width: 23%;
      margin-bottom: 40px;
      font-size: 12px;
      img {
          width: 100%;
          margin-bottom: 5px;
      }
      p {
          margin-bottom: 5px;
      }
  }
`;

export default Products;
